                }

                // Get node style
                function getNodeStyle(p, type) {
                    if (isSameNode(p.node, selectedNode)) {
                        return 'selectable-item selection';
                    }

                    if (p.isActive) {
                        return 'selectable-item active-' + type + '-node';
                    }

                    return 'selectable-item inactive-node';
                }

                // Function to render the graph
                function renderGraph() {
                    // Clear the SVG
                    svg.selectAll('*').remove();

                    // Process data
                    const edges = processEdges();
                    const activeNodes = getActiveNodes(edges);
                    const nodeProps = generateNodeProps(activeNodes);
                    const tokenLabels = generateTokenLabels();
                    const layerLabels = generateLayerLabels();
                    const tokenSelectors = generateTokenSelectors();

                    // Render layers highlight (alternate layers)
                    svg.selectAll('layers')
                        .data(Array.from({ length: nLayers }).map((_, i) => i).filter(x => x % 2 === 1))
                        .enter()
                        .append('rect')
                        .attr('class', 'layer-highlight')
                        .attr('x', xScale(-1.0))
                        .attr('y', layer => yScale(layer))
                        .attr('width', xScale(nTokens + 0.25) - xScale(-1.0))
                        .attr('height', layer => yScale(layer) - yScale(layer + 1))
                        .attr('rx', renderParams.layerCornerRadius);

                    // Render edges
                    svg.selectAll('edges')
                        .data(edges)
                        .enter()
                        .append('line')
                        .style('stroke', edge => {
                            if (isSameEdge(edge, selectedEdge)) {
                                return 'orange';
                            }

                            if (edge.isFfn) {
                                return ffnEdgeColorScale(edge.weight);
                            }

                            return colorScale(edge.weight);
                        })
                        .attr('class', edge => edge.isSelectable ? 'selectable-edge' : '')
                        .style('stroke-width', edge => edgeWidthScale(edge.weight))
                        .attr('x1', edge => edge.fromPos.x)
                        .attr('y1', edge => edge.fromPos.y)
                        .attr('x2', edge => edge.toPos.x)
                        .attr('y2', edge => edge.toPos.y)
                        .on('click', (event, edge) => handleEdgeClick(edge));

                    // Render residual nodes (AfterAttn and AfterFfn)
                    svg.selectAll('residual')
                        .data(nodeProps.filter(p => {
                            return p.node.item === CellItem.AfterAttn ||
                                   p.node.item === CellItem.AfterFfn;
                        }))
                        .enter()
                        .append('circle')
                        .attr('class', p => getNodeStyle(p, 'residual'))
                        .attr('cx', p => p.pos.x)
                        .attr('cy', p => p.pos.y)
                        .attr('r', renderParams.attnSize / 2)
                        .on('click', (event, p) => handleNodeClick(p.node));

                    // Render FFN nodes
                    svg.selectAll('ffn')
                        .data(nodeProps.filter(p => p.node.item === CellItem.Ffn && p.isActive))
                        .enter()
                        .append('rect')
                        .attr('class', p => getNodeStyle(p, 'ffn'))
                        .attr('x', p => p.pos.x - renderParams.ffnSize / 2)
                        .attr('y', p => p.pos.y - renderParams.ffnSize / 2)
                        .attr('width', renderParams.ffnSize)
                        .attr('height', renderParams.ffnSize)
                        .on('click', (event, p) => handleNodeClick(p.node));

                    // Render token labels
                    svg.selectAll('token_labels')
                        .data(tokenLabels)
                        .enter()
                        .append('text')
                        .attr('x', label => label.pos.x)
                        .attr('y', label => label.pos.y)
                        .attr('text-anchor', 'end')
                        .attr('dominant-baseline', 'middle')
                        .attr('alignment-baseline', 'top')
                        .attr('transform', label =>
                            'rotate(-40, ' + label.pos.x + ', ' + label.pos.y + ')')
                        .text(label => label.text);

                    // Render layer labels
                    svg.selectAll('layer_labels')
                        .data(layerLabels)
                        .enter()
                        .append('text')
                        .attr('x', label => label.pos.x)
                        .attr('y', label => label.pos.y)
                        .attr('text-anchor', 'middle')
                        .attr('alignment-baseline', 'middle')
                        .text(label => label.text);

                    // Render token selectors
                    svg.selectAll('token_selectors')
                        .data(tokenSelectors)
                        .enter()
                        .append('polygon')
                        .attr('class', ([i]) =>
                            activeToken === i
                                ? 'selectable-item selection'
                                : 'selectable-item token-selector'
                        )
                        .attr('points', ([, p]) => tokenPointerPolygon(p))
                        .attr('r', renderParams.tokenSelectorSize / 2)
                        .on('click', (event, [i]) => handleTokenClick(i));
                }

                // Initial render with the selected token
                activeToken = 5;
                renderGraph();
            })();
            </script>
        </body>
</html>
